export class CarItem extends Component{
	
   	constructor(props){
   		super(props);

   		this.handleLike=this.handleLike.bind(this);
   	}


 handleLike(){
    this.props.onLike(this.props.make);
    console.log('******');
}


   render(){



     return(
            
            <div id='main_div'>
              <label id='car_model'>{this.props.make.toUpperCase()}</label>
              <img id='car_img' src={this.props.imageUrl}/>
              <div id='cont_div'> 
              <div id='img_div'>
              <label id='price'>{this.props.price.toUpperCase()}</label>
              <label id='loc'>{this.props.loc.toUpperCase()}</label>
              <label id='yard'>{this.props.yard.toUpperCase()}</label>
              </div>
              <div id='call_div'>
              	<label id='call' class='fa fa-whatsapp'></label>
              </div>
              <div id='like_div'>
              	<label id='like' class='fa fa-heart' onClick={this.handleLike}></label>
              	<label id='count'>0</label>
              </div>
            </div>
            </div>  

     	);

   }
  
}
